INSERT INTO `citations` (`id`,`title`,`subtitle`,`alt_title`,`authors`,`editors`,`translators`,`changed`,`created`,`published`,`volume`,`issue`,`idnumber`,`edition`,`place_publication`,`place_state`,`publisher`,`publication_medium`,`url`,`page_from`,`page_to`,`data_accessed`,`organization`,`ctype`,`pub_day`,`pub_month`,`pub_year`,`abstract`) VALUES 
 (1,'African Development Indicators 2006','','','  World Bank ','0','0',1281463497,1281386813,1,'','','','etset','Washington','DC','World Bank Publications',0,'http://siteresources.worldbank.org/INTSTATINAFR/Resources/ADI_2006_text.pdf','','','','','book','30','Sept',2006,''),
 (2,'Gender differences in household resource allocations','Living standards measurement study (LSMS) working paper','','Thomas  Duncan ','0','0',1281463354,1281459665,1,'','LSM79','0821318233','','','','',0,'http://www-wds.worldbank.org/external/default/main?pagePK=64193027&piPK=64187937&theSitePK=523679&menuPK=64187510&searchMenuPK=64187283&theSitePK=523679&entityID=000178830_98101902173689&searchMenuPK=64187283&theSitePK=523679','','','','','journal','30','6',1991,'Using household survey data from the United States, Brazil, and Ghana, the authors examine the relationship between paternal education and child height, an indicator of health and nutritional status. In all three countries, the education of the mother has a bigger effect on her daughter\'s height; paternal education, in contrast, has a bigger impact on the son\'s height. There are apparently, differences in the allocation of household resources depending on the gender of the child and these differences vary with the gender of the parent. In Ghana, relative to other women, the education of a woman who is better educated than her husband has a bigger impact on the height of her daughter than her son. In Brazil, women\'s nonlabor income has a positive impact on the health of her daughter but not her son\'s health. If relative education of parents and nonlabor income are indicators of power in a household bargaining game, then these results suggest that gender differences in resource allocations reflect both technological differences in child rearing and differences in the preferences of parents.');
