 (8,'default','DCS-LKA-ASI-1997-v1.0','Sri Lanka Annual Survey of Industries - 1997','Sri Lanka Annual Survey of Industries - 1997 ASI 1997 DCS-LKA-ASI-1997-v1.0','Department of Census and Statistics, Ministry of Finance and Planning','National coverage','Sri Lanka','a:1:{s:5:\"topic\";a:2:{i:0;a:3:{s:4:\"name\";s:13:\"ECONOMICS [1]\";s:5:\"vocab\";s:6:\"CESSDA\";s:8:\"vocabURI\";s:33:\"http://www.nesstar.org/rdf/common\";}i:1;a:3:{s:4:\"name\";s:31:\"TRADE, INDUSTRY AND MARKETS [2]\";s:5:\"vocab\";s:6:\"CESSDA\";s:8:\"vocabURI\";s:33:\"http://www.nesstar.org/rdf/common\";}}}','The scope of the ASI covers all the activities categorised under three industry divisions namely, Mining and Quarrying, Manufacturing and Generation and Distribution of Electricity, Gas and Water of the International Standard Industrial classification Revision 2 (ISIC) of the United Nations. All private sector establishments with 5 or more persosns engaged, state owned industries and industries coming within the purview of Board of Investment have been covered in this survey. However, due to financial limitations and the none availability of a proper frame, the establishments with less than 5 persons engaged were not covered.DCS-LKA-ASI-1997-v1.0','\n          Enterprise Survey [en/oth]\n        ','Department of Census and Statistics','0','DCS-LKA-ASI-1997-v1.0','1996','94','DCS-LKA-ASI-1997-v1.0.xml','default/62298d786859aa4678655fc50ff075ed',NULL,NULL,NULL,NULL,NULL,2,1,0,'1281454485','1281454485',NULL,NULL,1996,1996),
 (10,'default','LKA-DCS-ASI-1999-v1.0','Annual Survey of Industries 1999','Annual Survey of Industries 1999 ASI 1999 LKA-DCS-ASI-1999-v1.0','Department of Census and Statistics, Ministry of Finance and Planning','National Coverage.','Sri Lanka','a:1:{s:5:\"topic\";a:2:{i:0;a:3:{s:4:\"name\";s:31:\"TRADE, INDUSTRY AND MARKETS [2]\";s:5:\"vocab\";s:6:\"CESSDA\";s:8:\"vocabURI\";s:33:\"http://www.nesstar.org/rdf/common\";}i:1;a:3:{s:4:\"name\";s:13:\"ECONOMICS [1]\";s:5:\"vocab\";s:6:\"CESSDA\";s:8:\"vocabURI\";s:33:\"http://www.nesstar.org/rdf/common\";}}}','The scope of the ASI is all activities categorised under three industry divisions namely, Mining and Quarrying, Manufacturing and Generation and Distribution of Electricity, Gas and Water of the International Standard Industrial classification revision 2(ISIC) of the United Nations. All private sector establishments with 5 or more persosns engaged, state owned industries and industries coming within the purview of Board of Investment have been covered in this survey. However, due to financial limitations and the none availability of a proper frame, the establishments with less than 5 persons engaged were not covered.LKA-DCS-ASI-1999-v1.0','\n          Enterprise Survey [en/oth]\n        ','Department of Census and Statistics','0','LKA-DCS-ASI-1999-v1.0','1999','88','LKA-DCS-ASI-1999-v1.0.xml','default/c2a23b06ff182a18e9536f14edfacdcd',NULL,NULL,NULL,NULL,NULL,NULL,1,0,'1281454485','1281454485',NULL,NULL,1999,1999),
 (11,'default','LKA-DCS-ASI-2000-v1.0','Sri Lanka Annual Survey of Industries 2000','Sri Lanka Annual Survey of Industries 2000 ASI 2000 LKA-DCS-ASI-2000-v1.0','Department of Census and Statistics, Ministry of Finance and Planning','National Coverage.','Sri Lanka','a:1:{s:5:\"topic\";a:2:{i:0;a:3:{s:4:\"name\";s:31:\"TRADE, INDUSTRY AND MARKETS [2]\";s:5:\"vocab\";s:6:\"CESSDA\";s:8:\"vocabURI\";s:33:\"http://www.nesstar.org/rdf/common\";}i:1;a:3:{s:4:\"name\";s:13:\"ECONOMICS [1]\";s:5:\"vocab\";s:6:\"CESSDA\";s:8:\"vocabURI\";s:33:\"http://www.nesstar.org/rdf/common\";}}}','The scope of the ASI is all activities categorised under three industry divisions namely, Mining and Quarrying, Manufacturing and Generation and Distribution of Electricity, Gas and Water of the International Standard Industrial classification revision 2(ISIC) of the United Nations. All private sector establishments with 5 or more persosns engaged, state owned industries and industries coming within the purview of Board of Investment have been covered in this survey. However, dueto financial limitations and the none availability of a proper frame, the establishments with less than 5 persons engaged were not covered.LKA-DCS-ASI-2000-v1.0','\n          Enterprise Survey [en/oth]\n        ','Department of Census and Statistics','0','LKA-DCS-ASI-2000-v1.0','2000','88','LKA-DCS-ASI-2000-v1.0.xml','default/30f9777185b2502703c676c4b2c20f27',NULL,NULL,NULL,NULL,NULL,1,1,0,'1281454486','1281454486',NULL,NULL,2000,2000),
 (16,'default','ag-eth-survey-1997','Agricultural sample survey 1997/98(1990EC)','Agricultural sample survey 1997/98(1990EC) Agss1997/98(1990EC)','Central Statistical Agency','The 1997/98 (1990 E.c) annual Agricultural sample Survey used a sampling frame designed to cover the','Ethiopia','s:0:\"\";','The 1997/98 (1990 E.c) annual Agricultural sample Survey used a sampling frame designed to cover the sedentary rural agricultural population in all regions of the country. urban and nomadic areas were not included in the survey . Illustrated in Table A is a break down of the sample distribution as expressed by regions, zones and weredas. A total of 56 zones and 409 weredas were actually covered by the survey. The lowest level sampling unit used for this survey is defined as an enumeration area (EA) as identified for the 1994 Population census. For the 1997/98 AgSS a total of 1420 enumeration areas were selected from all regions of the country. Due to various reasons, 71 of them were incompletely enumerated which resulted in covering 1349 Eas. From each of the Selected EAs a representative sample of 40 agricultural house holds were selected to estimate the various agricultural population were selected to estimate the various agricultural population items of interest of the sampled EA. Of these 40 agricultural households, the first 25 were used for obtaining information on area under crops, Meher and Belg season production of major crops, land utilization, agricultural practices, crop damage and quantity of agricultural inputs used. It is important to note that of the total 40 agricultural households Sampled in the selected EAs, data on crop cutting were collected for only the 15 \' households (11th -25th households selected), for the area and production survey.ag-eth-survey-1997','\n          Agricultural Sample Survey\n        ','Central Statistical Agency','0','ag-eth-survey-1997','0','281','ag-eth-survey-1997.xml','default/7d33fbce5da4ce605bf2671f175535c3',NULL,'http://www.example.org',NULL,'http://www.example.org',NULL,3,1,0,'1281461093','1281460388',NULL,NULL,0,0);
